--
-- Name: get_rolle_prestudent(integer, character varying); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION get_rolle_prestudent(integer, character varying) RETURNS character varying
    LANGUAGE plpgsql
    AS $_$
                        DECLARE i_prestudent_id ALIAS FOR $1;
                        DECLARE cv_studiensemester_kurzbz ALIAS FOR $2;
                        DECLARE rec RECORD;
                        BEGIN
                            IF (cv_studiensemester_kurzbz IS NULL) THEN
                                SELECT INTO rec status_kurzbz 
                                FROM public.tbl_prestudentstatus
                                WHERE prestudent_id=i_prestudent_id 
                                ORDER BY datum desc,insertamum desc, ext_id desc
                                LIMIT 1;
                            ELSE
                                SELECT INTO rec status_kurzbz 
                                FROM tbl_prestudentstatus 
                                WHERE prestudent_id=i_prestudent_id AND studiensemester_kurzbz=cv_studiensemester_kurzbz
                                ORDER BY datum desc,insertamum desc, ext_id desc
                                LIMIT 1;
                            END IF;

                        RETURN rec.status_kurzbz;
                        END;
                        $_$;


ALTER FUNCTION public.get_rolle_prestudent(integer, character varying) OWNER TO postgres;

