<p>Das FH-Kollegium besteht aus 4 VertreterInnen der Studierenden, 6 VertreterInnen des Lehr- und Forschungspersonals, 6 StudiengangsleiterInnen, dem Rektor und dem Vizerektor.</p>
<p>Engagierte VertreterInnen aus dem Kreise unserer Lehrenden und F&amp;E MitarbeiterInnen sind im Kollegium sehr wichtig. Daher ersuche ich Sie als VertreterInnen unserer Lehrenden f&uuml;r das FH-Kollegium zu kandidieren.</p>
<p>Bitte geben Sie Ihre <strong>Kandidatur bis 25.05.2012</strong> formlos schriftlich oder per E-Mail bei Frau Nicole Sagmeister (5. Stock, Zimmer 5.31, nicole.sagmeister@technikum-wien.at) bekannt. Die (Brief-)Wahl wird vom 01.06. &ndash; 15.06.2012 stattfinden.</p>
<p>Das W&auml;hlerverzeichnis ist am CIS unter Fachhochschulkollegium - Kollegiumswahl 2012 ebenfalls einsehbar.</p>
<p>Im Namen der Wahlkommission</p>
<p>Rektor FH-Prof. Dipl.-Ing. Dr. Fritz Schm&ouml;llebeck</p>]]></text></news>', NULL, NULL, '2012-05-22 15:58:06', 'admin', '2012-05-22 15:57:38', 'admin', 'Wahl der VertreterInnen des Lehr- und Forschungspersonals im FH-Kollegium', NULL);
